import React from 'react'
import styled from 'styled-components';

const Circle = styled.div`
  height: 50px;
  width: 50px;
  border-radius: 50%;
  border-color: #324BB8;
  border-style: solid;
  border-width: 2px;
`;

class Measurement extends React.Component {
  render() {

      console.log(this.props);

  }
}

export default Measurement;
